        setName(e.target.value)
    }

    const addPerson = (e) => {
        e.preventDefault();
        e.target.reset();
    }
    return (
        <div>
            <h1> your name </h1>
            <h3>{name}</h3>
            <form onSubmit={addPerson}>
                <input onChange={inputHandler}></input>

            </form>
            <p>list of names</p>
            {
                People.map((item, idx) => {
                    return (
                        <div>
                            {item}
                        </div>
                    )
                })
            }

        </div>
    )
}
